import React, { useState, useEffect } from "react";

const EmailList = () => {
  const [emails, setEmails] = useState([]);

  useEffect(() => {
    fetch("/human_sorted/index.json")
      .then((response) => {
        if (!response.ok) {
          throw new Error("Error fetching the email list.");
        }
        return response.json();
      })
      .then((data) => {
        const cleanedEmails = data.map((email) =>
          email.replace(/__+/g, "_")
        );
        setEmails(cleanedEmails);
      })
      .catch((error) => {
        console.error("Error fetching email list:", error);
      });
  }, []);

  return (
    <div>
      <h1>Email List</h1>
      <ul>
        {emails.map((email, index) => (
          <li key={index}>{email}</li>
        ))}
      </ul>
    </div>
  );
};

export default EmailList;
